import React from 'react';
import styled from 'styled-components';

const Title = styled("h3")`
font-family: Open Sans;
font-style: normal;
font-weight: 600;
font-size: 20px;
line-height: 27px;
color: #444444;
margin: 7px 0px;

`;
const TitleBorder = styled("div")`

border-bottom: 2px solid #A02167;
width:70px;
text-align:center;
align:center;

`;


export {Title, TitleBorder}
